require(['jquery','domReady!'],function($){'use strict';$(document).ready(function(){function updateUrlParameter(uri,key,value){var re=new RegExp('([?&])'+key+'=.*?(&|$)','i'),separator=uri.indexOf('?')!==-1?'&':'?';if(uri.match(re)){uri=uri.replace(re,'$1'+key+'='+value+'$2');}else{uri=uri+separator+key+'='+value;}
return uri;}
function changeUrls(value){var elmToChange=['#row_connector_developer_settings_sync_settings_reset_orders','#row_connector_developer_settings_sync_settings_reset_reviews','#row_connector_developer_settings_sync_settings_reset_wishlists','#row_connector_developer_settings_sync_settings_reset_catalog'];if($('#row_connector_developer_settings_sync_settings_reset_quotes').length){elmToChange.push('#row_connector_developer_settings_sync_settings_reset_quotes');}
$.each(elmToChange,function(k,v){var button=$(v).find('button'),str=button.attr('onclick'),updatedUrl=updateUrlParameter(str,value,encodeURIComponent($('#'+value).val()));button.attr('onclick',updatedUrl);});}
function observeChange(value){$('#'+value).change(function(){changeUrls(value);});}
function start(){var elmToObserve=['from','to'];$.each(elmToObserve,function(key,value){observeChange(value);});}
start();});});